export var CONTAINER_CLASS = 'l7plot-legend l7plot-legend__category';
export var TITLE_CLASS = 'l7plot-legend__title';
export var LIST_CLASS = 'l7plot-legend__category-list';
export var LIST_ITEM_CLASS = 'l7plot-legend__list-item';
export var MARKER_CLASS = 'l7plot-legend__category-marker';
export var VALUE_CLASS = 'l7plot-legend__category-value';
export var CONTAINER_TPL = "<div class=\"".concat(CONTAINER_CLASS, "\">\n  <div class=\"").concat(TITLE_CLASS, "\"></div>\n  <ul class=\"").concat(LIST_CLASS, "\"></ul>\n</div>");
export var ITEM_TPL = "<li class=\"".concat(LIST_ITEM_CLASS, "\" data-index={index}>\n  <span class=\"").concat(MARKER_CLASS, "\" style=\"background:{color}\"></span>\n  <span class=\"").concat(VALUE_CLASS, "\">{value}</span>\n</li>");
